const[add, setAdd] =useState({
    val:"",
    id:""
})

function get(val,id){
   return add.val=val,add.id=id }

  return <div>
<Navbar zero={add.val} ind={add.m} />
<Nxt />
<Inter 
    tot={get}
/>

  </div>
}
 

export default App
